import {useParams} from "react-router-dom";
import {useEffect, useState} from "react";
function MovieDetail({data}) {
  const {id} = useParams();
  console.log(id);
  console.log("Data Movie Detail:", data);
  const [detail, setDetail] = useState({});

  useEffect(() => {
    fetch(
      `https://api.themoviedb.org/3/movie/${id}?api_key=131f3dc4657440aa2ed80c0a22a7d1f9&language=en-US`
    )
      .then((res) => res.json())
      .then((res) => {
        console.log(res);
        setDetail(res);
      }, console.log("Vo duoc day roi "))
      .catch((err) => {
        console.log("Loi day ne ", err);
      });
  }, []);

  console.log(detail);

  return (
    <div>
      {data.map((film) => (
        <div>{film.id}</div>
      ))}
    </div>
  );
}

export default MovieDetail;
